import React from "react";
import {
  Drawer,
  Input,
  InputNumber,
  Select,
  Button,
  Form,
  Row,
  Col
} from "antd";

const { Option } = Select;
const Drawers = ({
  visible,
  onClose,
  name,
  price,
  age,
  address,
  phone,
  namehandleChange,
  priceHandleChange,
  typehandleChange,
  agehandleChange,
  addresshandleChange,
  phoneHandleChange,
  handleAdd
}) => {
  return (
    <Drawer
      width={420}
      title="Add New Personal"
      closable={false}
      placement="right"
      onClose={onClose}
      visible={visible}
    >
      <Form>
        <Form.Item>
          <Input
            placeholder="Name"
            value={name}
            onChange={namehandleChange}
            allowClear
          />
        </Form.Item>
        <Form.Item>
          <InputNumber
            placeholder="Salary"
            value={price}
            onChange={priceHandleChange}
            // style={{ width: "150px" }}
          />
        </Form.Item>
        <Form.Item>
          <Select
            onChange={typehandleChange}
            defaultValue="Select"
            // style={{ width: "150px" }}
          >
            <Option value="Waiter">Waiter</Option>
            <Option value="Chef">Chef</Option>
            <Option value="Employee">Employee</Option>
          </Select>
        </Form.Item>
        <Form.Item>
          <InputNumber
            placeholder="age"
            value={age}
            onChange={agehandleChange}
            style={{ width: "150px" }}
            max={11}
          />
        </Form.Item>
        <Form.Item>
          <Input
            placeholder="Address"
            value={address}
            onChange={addresshandleChange}
            allowClear
          />
        </Form.Item>
        <Form.Item>
          <InputNumber
            style={{ width: "150px" }}
            placeholder="Phone"
            value={phone}
            onChange={phoneHandleChange}
            max={11}
          />
        </Form.Item>

        <Form.Item>
          <Button
            onClick={handleAdd}
            type="primary"
            style={{ marginBottom: 16, width: "100px" }}
          >
            Add
          </Button>
        </Form.Item>
      </Form>
    </Drawer>
  );
};

export default Drawers;
